import{_ as e,c as t,o as a,N as o}from"./chunks/framework.0799945b.js";const w=JSON.parse('{"title":"Connect Wallet","description":"","frontmatter":{},"headers":[],"relativePath":"tutorials/connect.md"}'),n={name:"tutorials/connect.md"},l=o('<h1 id="connect-wallet" tabindex="-1">Connect Wallet <a class="header-anchor" href="#connect-wallet" aria-label="Permalink to &quot;Connect Wallet&quot;">​</a></h1><h2 id="supported-wallets" tabindex="-1">Supported Wallets <a class="header-anchor" href="#supported-wallets" aria-label="Permalink to &quot;Supported Wallets&quot;">​</a></h2><p>Pando Proto supports <a href="https://docs.pando.im/docs/wallets/mixin-messenger" target="_blank" rel="noreferrer">Mixin Messenger</a>, <a href="https://pando.im/fennec/" target="_blank" rel="noreferrer">Fennec</a>, <a href="https://metamask.io/" target="_blank" rel="noreferrer">Metamask</a> and all walletconnect compatible wallets.</p><h2 id="connect-with-metamask" tabindex="-1">Connect with Metamask <a class="header-anchor" href="#connect-with-metamask" aria-label="Permalink to &quot;Connect with Metamask&quot;">​</a></h2><p>Visit <a href="https://app.pando.im/" target="_blank" rel="noreferrer">Pando</a> and connect with Metamask wallet by tapping the &quot;Connect Wallet&quot; button and choosing the &quot;Metamask&quot; method.</p><p>You will asked to sign a message in EIP-4361 format. Please sign the message and you will be connected to Pando.</p><h2 id="connect-with-walletconnect-compatible-wallets" tabindex="-1">Connect with WalletConnect Compatible Wallets <a class="header-anchor" href="#connect-with-walletconnect-compatible-wallets" aria-label="Permalink to &quot;Connect with WalletConnect Compatible Wallets&quot;">​</a></h2><h3 id="connect-to-mvm-bridge-with-walletconnect" tabindex="-1">Connect to MVM Bridge with WalletConnect <a class="header-anchor" href="#connect-to-mvm-bridge-with-walletconnect" aria-label="Permalink to &quot;Connect to MVM Bridge with WalletConnect&quot;">​</a></h3><p>Visit <a href="https://bridge.mvm.app/" target="_blank" rel="noreferrer">MVM Bridge</a> and connect with WalletConnect compatible wallet by choosing &quot;WalletConnect&quot; method. You can deposit or withdraw cryptocurrency via bridge.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>If you are the first time to use Pando with the wallet, you may need to deposit some cryptocurrency via MVM Bridge first. You can use the &quot;Deposit&quot; button to deposit cryptocurrency to MVM Bridge.</p></div><h3 id="connect-to-pando-with-walletconnect" tabindex="-1">Connect to Pando with WalletConnect <a class="header-anchor" href="#connect-to-pando-with-walletconnect" aria-label="Permalink to &quot;Connect to Pando with WalletConnect&quot;">​</a></h3><p>Visit <a href="https://app.pando.im/" target="_blank" rel="noreferrer">Pando</a> and connect with Metamask wallet by tapping the &quot;Connect Wallet&quot; button and choosing the &quot;Wallet Connect&quot; method.</p><p>You will asked to sign a message in EIP-4361 format. Please sign the message and you will be connected to Pando.</p><h2 id="connect-onekey-wallet" tabindex="-1">Connect OneKey Wallet <a class="header-anchor" href="#connect-onekey-wallet" aria-label="Permalink to &quot;Connect OneKey Wallet&quot;">​</a></h2><p>Before connecting Pando with OneKey, please read <a href="https://help.onekey.so/hc/en-us" target="_blank" rel="noreferrer">the official documentation</a> for initial setup of OneKey.</p><h3 id="connect-to-mvm-bridge-with-onekey" tabindex="-1">Connect to MVM Bridge with OneKey <a class="header-anchor" href="#connect-to-mvm-bridge-with-onekey" aria-label="Permalink to &quot;Connect to MVM Bridge with OneKey&quot;">​</a></h3><p>Visit <a href="https://bridge.mvm.app/" target="_blank" rel="noreferrer">MVM Bridge</a> and connect with OneKey wallet by choosing &quot;WalletConnect&quot; method. You can deposit or withdraw cryptocurrency via bridge.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>If you are the first time to use Pando with OneKey, you may need to deposit some cryptocurrency via MVM Bridge first. You can use the &quot;Deposit&quot; button to deposit cryptocurrency to MVM Bridge.</p></div><h3 id="connect-to-pando-with-onekey" tabindex="-1">Connect to Pando with OneKey <a class="header-anchor" href="#connect-to-pando-with-onekey" aria-label="Permalink to &quot;Connect to Pando with OneKey&quot;">​</a></h3><p>Visit <a href="https://app.pando.im/" target="_blank" rel="noreferrer">Pando</a> and connect with OneKey wallet by tapping the &quot;Connect Wallet&quot; button and choosing the &quot;OneKey&quot; method.</p><p>You will asked to sign a message in EIP-4361 format. Please sign the message and you will be connected to Pando.</p>',21),r=[l];function c(i,s,h,d,p,u){return a(),t("div",null,r)}const b=e(n,[["render",c]]);export{w as __pageData,b as default};
